configure:
  commands:
    address-family ipv6 unicast autonomous-system 200: "address-family ipv6 unicast\
      \ autonomous-system\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\
      \b\b\b\b\b\b\b\b\b\b\b\b\b\b\b\b$ily ipv6 unicast autonomous-system        \
      \  \b\b\b\b\b\b\b\b\b200\r\n"
    end:
      new_state: execute
    line console 0:
      new_state: configure_line
    no logging console: ''
    nsf: "nsf\r\n"
    router eigrp test: "router eigrp test\r\n"
  prompt: stack3-nyquist-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: stack3-nyquist-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: stack3-nyquist-1#
